name: list-asset-bundle-import-jobs
description: Lists all asset bundle import jobs that have taken place in the last 14 days.
flags:
    --aws-account-id=!: The ID of the Amazon Web Services account that the import jobs were executed in.
    --max-results=: The maximum number of results to be returned per request.
    --next-token=: The token for the next set of results, or null if there are no more results.
